import "./imgApp.css"
import React,{ useState, useEffect } from "react";


function useInterval(callback, interval) {
    useEffect(() => {
        const start = new Date().getTime()
        const I = setInterval(()=>{
            callback(new Date().getTime() - start)
        },interval)
        return () => clearInterval(I)
    }, [])
}



const imgs = [
    'https://images.unsplash.com/photo-1593642702909-dec73df255d7?ixid=MnwxMjA3fDF8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=1169&q=80',
    'https://images.unsplash.com/photo-1623596832892-5acc3b0b30e3?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=1158&q=80',
    'https://images.unsplash.com/photo-1624595111085-79ec6cce2154?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=1175&q=80',
    'https://images.unsplash.com/photo-1491223343498-58796d6b503d?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1170&q=80',
    'https://images.unsplash.com/photo-1493857671505-72967e2e2760?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1170&q=80'
];

const imgApp = () =>{
    return (
        <div className="scroller">
            <div 
                className="inner" 
                style={{
                    width:`${imgs.length * 100}%`,
                    transform:`translateX(-32%)`
                }}>
                {imgs.map(src => {
                    return (
                        <img
                            style = {{
                                width:`${100/imgs.length}%`
                            }} 
                        key = {src}
                        alt=""
                        src={src} 
                    />);
                })}
            </div>
        </div>
    )
}


export default imgApp
